  `venue` varchar(100) NOT NULL,
  `min_team_size` int(11) NOT NULL,
  `max_team_size` int(11) NOT NULL,
  `min_teams` int(11) NOT NULL,
  `max_teams` int(11) NOT NULL,
  `contact` varchar(140) NOT NULL,
  `category_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `events_mainevent_category_id_c41dfc82_fk_events_category_id` (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=latin1;
